import React from 'react';
import { withStyles } from '@material-ui/core/styles';

const styles = {
  root: {
    background: '#fff',
  }
};


const Tile = props => {
  const { classes, title, content } = props;


  return (
    <div className={classes.root}>
    <h2>{title.value}</h2>
    <p>{content.value}</p>
    </div>
  );
};

export default withStyles(styles)(Tile);
